export class echodopplerTransc
{
    PatientId:number;
    EchodopplerTransc1:boolean;
    Edtc:boolean;
    DateEdtc:string;
    ResEdtc:string;
    PreciserStenose:string;
    constructor()
    {
        this.PatientId=0;
        this.EchodopplerTransc1=false;
        this.Edtc=false;
        this.DateEdtc='';
        this.ResEdtc='';
        this.PreciserStenose='';

    }
}
